    id: FourStoreConnector
    path: Libraries/dotNetRDF/Storage/FourStoreConnector.cs
    startLine: 54
  assemblies:
  - dotNetRDF
  namespace: VDS.RDF.Storage
  summary: "\nClass for connecting to 4store.\n"
  remarks: "\n<p>\nDepending on the version of <a href=\"http://librdf.org/rasqal/\">RASQAL</a> used for your 4store instance and the options it was built with some kinds of queries may not suceed or return unexpected results.\n</p>\n<p>\nPrior to the 1.x releases 4store did not permit the saving of unamed Graphs to the Store or Triple level updates.  There was a branch of 4store that supports Triple level updates and you could tell the connector if your 4store instance supports this when you instantiate it.  From the 0.4.0 release of the library onwards this support was enabled by default since the 1.x builds of 4store have this feature integrated into them by default.\n</p>\n"
  example: []
  syntax:
    content: 'public class FourStoreConnector : BaseAsyncHttpConnector, IAsyncUpdateableStorage, IAsyncQueryableStorage, IAsyncStorageProvider, IConfigurationSerializable, IUpdateableStorage, IQueryableStorage, IStorageProvider, IStorageCapabilities, IDisposable'
